import React from "react";
import settings from "../../../src/assets/Icons/settings.jpg";
export default function Swap() {
  return (
    // center div with glassmorphism
    <div
      className="container"
      style={{
        display: "flex",
        height: "40vh",
        width: "30vw",
        border: "1px solid rgba(255, 255, 255, 0.2)",
        backdropFilter: "blur(4px)",
        //rounded corners
        borderRadius: "10px",
      }}>
      <h3 className="text-white">Hello i am suresh raina</h3>
    </div>
  );
}
